import React from "react";
import { Navigate,Outlet } from "react-router-dom";
import AuthHandler from "./AuthHandler";

export const PrivateRoute = ({...rest}) => {
    
  return (
    AuthHandler.loggedIn() ? <Outlet/> : <Navigate to='/'/>
    )
  }
